// {
//     AuthButtons = (
//       NavbarOpen
//     );
// } else {

//   Authbuttons = (Navbar);


// }





// Homepage

const Home = () => {
  return (
    <div className="front_end">

     {AuthCheck.AuthNavbar}

      <Slider />

      <Banner title="Autókölcsönzés" />

      <LoginForm form_text="Az autókölcsönzéshez be kell jelentkeznie!" />

      {AuthCheck.AuthFooter}

    </div>
  )
}


const App = () => {

  return (
    <div className="front_end">
      <Router>
        <ScrollToTop />
        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/rolunk" exact component={About} />
          <Route path="/husegprogram" exact component={LoyaltyProgram} />
          <Route path="/login" exact component={Login} />
          <Route path="/regisztracio" exact component={Register} />
          <Route path="/modelljeink" exact component={OurModels} />
          <Route path="/expand" exact component={Expand} />
          <Route path="/ajandekbolt" exact component={GiftShop} />
          <Route path="/kolcsonzes" exact component={CarRental_LoggedIn} />
          <Route path="/admin" exact component={Dashboard} />
        </Switch>
      </Router>
    </div>
  )
}

export default App
